import React from "react";
import { Container, Row, Col, Label, Input, Button } from "reactstrap";
import { ReactFlow } from '../components/ReactFlow';


const elements = [
  { id: '1', data: { label: 'Node 1' }, position: { x: 250, y: 5 } },
  // you can also pass a React component as a label
  { id: '2', data: { label: <div>Node 2</div> }, position: { x: 100, y: 100 } },
  { id: 'e1-2', source: '1', target: '2', animated: true },
];

export const Main = () => {
	return (
		<Container className="d-flex flex-column">
			<Row className="h-100 my-1">
				<Col lg={4} className="p-0">
					<Container className="h-100 p-0 d-flex flex-column">
			        	<Label for="dataExample" className="text-primary">Data</Label>
		        		<small className="text-secondary">
		        			Paste some example data here for comparison
		        		</small>
				        <Input type="textarea" name="text" id="dataExample" className="my-2" resizable={false}/>
			        	<Button variant="primary">Process</Button>
				    </Container>
				</Col>
				<Col lg={8}>
					<ReactFlow elements={ elements }/>
				</Col>
			</Row>
		</Container>
	)
}
